import { PageContainer } from '@ant-design/pro-components';
import React, { useEffect, useState } from 'react';
import {Button, Card, Descriptions, Form, message, Input, Spin, Divider} from 'antd';
import {
  getInterfaceInfoByIdUsingGET,
  invokeInterfaceInfoUsingPOST,
} from '@/services/yuapi-backend/interfaceInfoController';
import { useParams } from '@@/exports';

/**
 * 
 * @constructor
 */
const Index: React.FC = () => {
  const [loading, setLoading] = useState(false);
  const [data, setData] = useState<API.InterfaceInfo>();
  const [invokeRes, setInvokeRes] = useState<any>();
  const [invokeLoading, setInvokeLoading] = useState(false);

  const params = useParams();

  const loadData = async () => {
    if (!params.id) {
      message.error('');
      return;
    }
    setLoading(true);
    try {
      const res = await getInterfaceInfoByIdUsingGET({
        id: Number(params.id),
      });
      setData(res.data);
    } catch (error: any) {
      message.error('' + error.message);
    }
    setLoading(false);
  };

  useEffect(() => {
    loadData();
  }, []);

  const onFinish = async (values: any) => {
    if (!params.id) {
      message.error('');
      return;
    }
    setInvokeLoading(true);
    try {
      const res = await invokeInterfaceInfoUsingPOST({
        id: params.id,
        ...values,
      });
      setInvokeRes(res.data);
      message.success('');
    } catch (error: any) {
      message.error('' + error.message);
    }
    setInvokeLoading(false);
  };

  return (
    <PageContainer title="">
      <Card>
        {data ? (
          <Descriptions title={data.name} column={1}>
            <Descriptions.Item label="">{data.status ? '' : ''}</Descriptions.Item>
            <Descriptions.Item label="">{data.description}</Descriptions.Item>
            <Descriptions.Item label="">{data.url}</Descriptions.Item>
            <Descriptions.Item label="">{data.method}</Descriptions.Item>
            <Descriptions.Item label="">{data.requestParams}</Descriptions.Item>
            <Descriptions.Item label="">{data.requestHeader}</Descriptions.Item>
            <Descriptions.Item label="">{data.responseHeader}</Descriptions.Item>
            <Descriptions.Item label="">{data.createTime}</Descriptions.Item>
            <Descriptions.Item label="">{data.updateTime}</Descriptions.Item>
          </Descriptions>
        ) : (
          <></>
        )}
      </Card>
      <Divider />
      <Card title="">
        <Form name="invoke" layout="vertical" onFinish={onFinish}>
          <Form.Item label="" name="userRequestParams">
            <Input.TextArea />
          </Form.Item>
          <Form.Item wrapperCol={{ span: 16 }}>
            <Button type="primary" htmlType="submit">

            </Button>
          </Form.Item>
        </Form>
      </Card>
      <Divider />
      <Card title="" loading={invokeLoading}>
        {invokeRes}
      </Card>
    </PageContainer>
  );
};

export default Index;

