          {status === 'error' && loginType === 'mobile' && <LoginMessage content="" />}
          {type === 'mobile' && (
            <>
              <ProFormText
                fieldProps={{
                  size: 'large',
                  prefix: <MobileOutlined className={styles.prefixIcon} />,
                }}
                name="mobile"
                placeholder={''}
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                  {
                    pattern: /^1\d{10}$/,
                    message: '',
                  },
                ]}
              />
