                  size: 'large',
                }}
                placeholder={''}
                captchaTextRender={(timing, count) => {
                  if (timing) {
                    return `${count} ${''}`;
                  }
                  return '';
                }}
                name="captcha"
                rules={[
                  {
                    required: true,
                    message: '',
                  },
                ]}
                onGetCaptcha={async (phone) => {
                  const result = await getFakeCaptcha({
                    phone,
                  });
                  if (result === false) {
                    return;
                  }
                  message.success('1234');
                }}
              />
            </>
          )}
          <div
            style={{
              marginBottom: 24,
            }}
          >
            <ProFormCheckbox noStyle name="autoLogin">

            </ProFormCheckbox>
            <a
              style={{
                float: 'right',
              }}
            >
               ?
            </a>
          </div>
        </LoginForm>
      </div>
      <Footer />
    </div>
  );
};
